import classes from "./AvailableMeals";
import Card from "../UI/Card";
import MealItem from "./MealItem/MealItem";

const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'Pedestal Fan',
      description: 'Do away with the blazing heat with this epic windbreaker!',
      price: 40.01,
    },
    {
      id: 'm2',
      name: 'Schnitzel',
      description: 'A german specialty!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Broom',
      description: 'Dust see, Dust sweep',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Painting',
      description: 'Art lies in the hands of the buyer',
      price: 18.99,
    },
  ];

const AvailableMeals = props => {


    const marketList = DUMMY_MEALS.map ((meal) => 
       <MealItem key = {meal.id} name = {meal.name} description={meal.description} price = {meal.price}></MealItem>
    )
    return <section className={classes.meals}>
        <Card>
        <ul>
            {marketList}
        </ul>
        </Card>


    </section>


}

export default AvailableMeals;
